    "narrative-report-bombay-hook-national-wildlife-refuge-january-december-1965",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Bombay
    Hook NWR outlines Refuge accomplishments during the 1965 calendar year. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, vegetation control, and wildfires.
    Resource management is outlined; topics include haying, fur harvesting, and commercial
    fishing. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, violations, and safety. Items of
    interest, N-R forms, photographs, and newspaper articles are attached.",nt"license_title":
